@1:06:50 Lee make's a move that even the AI recognised as having one-in-tenthousanth chance of being made. This move set the course for AlphaGo's downfall in that match. I feel people don't see the reality of how immense this is. This is a match against an AI that can learn from thousands, maybe millions of matches in just a matter of hours. Also, this AI is supported by the brute computational capacity to look into the future in a way that no human maybe able to match. Imagine calculating every possible move for the next 95 steps! (If you cant imagine,  that would be like counting all the stars in the universe)  But that is exactly what the AI did and still it lost to Lee. Imagine.. even if it made a wrong move (which it recognised) it could still search thousands or millions of other possibilities and recover, but it couldn't.

@1:08:37 ...it searched the most number of steps into the future (95) than ever before (doesn't...  that mean it got cornered?)
From a state where the AI showed >80%  chance of winning, after this move, it wen't plummeting down to 45%

@1:08:49 ..."I think it searched so much that it lost itself". Guys, this is a machine with CPUs and GPUs that have the compute capacity that no human can match. If this kind of a machine searched so much and couldn't find a way out...

My humble respect to Lee for making that iconic move in GO history that even an AI with these many insanely large advantages could not work its way out of. **Truely God's move**. @1:15:09

@1:12:13 ...the pain in his heart, and how much this one game changed him.
